import React, { useState } from 'react';

type Package = {
  name: string;
  description: string;
  params: {
    [key: string]: number;
  };
};

type Pricing = {
  [year: number]: {
    [packageKey: string]: number;
  };
};

const packages: { [key: string]: Package } = {
  A: { 
    name: 'Flexible', 
    description: 'Flexible',
    params: {
      'Term Rent': 156,
      'Network WiFi': 20,
      'Branding and Signage': 15,
      'Base Rent': 69,
    }
  },
  B: { 
    name: 'Inclusive', 
    description: 'Inclusive',
    params: {
      'Furniture': 24,
      'Full Digital Infrastructure': 12,
      'Plants Programming': 15,
      'Food & Beverage Service': 61,
    }
  },
  C: { 
    name: 'Fully Managed', 
    description: 'Fully Managed',
    params: {
      'Dedicated WX': 34,
      'Package Handling': 66,
      'Hardware & Data': 52,
      'IT/AV Help Desk': 22,
    }
  }
};

const pricing: Pricing = {
  2: { A: 100000, B: 120000, C: 140000 },
  3: { A: 80000, B: 100000, C: 120000 },
  4: { A: 60000, B: 80000, C: 100000 },
  5: { A: 60000, B: 80000, C: 100000 }
};

const App: React.FC = () => {
  const [selectedPackage, setSelectedPackage] = useState<string | null>(null);
  const [selectedTerm, setSelectedTerm] = useState<number | null>(null);

  const handleSelection = (pkg: string, term: number) => {
    setSelectedPackage(pkg);
    setSelectedTerm(term);
  };

  return (
    <div className="flex p-4 font-['Inter'] font-black" style={{ color: '#A82229' }}>
      <div className="w-2/3">
        <div className="grid grid-cols-3 gap-1 mb-1">
          {Object.entries(packages).map(([key, value]) => (
            <div key={key} className="border border-[#A82229] p-2 text-center h-20 flex flex-col justify-center">
              <h3 className="text-4xl font-bold">{key}</h3>
              <p>{value.description}</p>
            </div>
          ))}
        </div>
        <div className="grid grid-cols-4 gap-1">
          <div className="font-bold h-20 flex items-center">Term</div>
          {Object.entries(pricing).map(([term, prices]) => (
            <React.Fragment key={term}>
              <div className={`font-bold text-2xl h-20 flex items-center ${parseInt(term) === 5 ? 'opacity-20' : ''}`}>Year {term.padStart(2, '0')}</div>
              {Object.entries(prices).map(([pkg, price]) => (
                <button
                  key={`${term}-${pkg}`}
                  className={`p-2 bg-[#A82229] text-white text-2xl font-bold h-20 w-full flex items-center justify-center
                    ${parseInt(term) === 2 ? 'opacity-50' : 
                      parseInt(term) === 3 ? 'opacity-80' : 
                      parseInt(term) === 4 ? 'opacity-100' : 'opacity-20'}`}
                  onClick={() => handleSelection(pkg, parseInt(term))}
                >
                  <span className="text-sm align-super">$</span>
                  <span className="text-2xl">{price / 1000}</span>
                  <span className="text-sm align-sub">k</span>
                </button>
              ))}
            </React.Fragment>
          ))}
        </div>
      </div>
      <div className="w-1/3 pl-4">
        <Sidebar selectedPackage={selectedPackage} selectedTerm={selectedTerm} />
      </div>
    </div>
  );
};

interface SidebarProps {
  selectedPackage: string | null;
  selectedTerm: number | null;
}

const Sidebar: React.FC<SidebarProps> = ({ selectedPackage, selectedTerm }) => {
  if (!selectedPackage || !selectedTerm) return null;

  const price = pricing[selectedTerm][selectedPackage];

  const allParams = {
    ...packages.A.params,
    ...packages.B.params,
    ...packages.C.params
  };

  return (
    <div className="border border-[#A82229] rounded-lg p-4 text-[#A82229]">
      <div className="flex justify-between items-center mb-4">
        <div>
          <div className="text-3xl font-bold">{selectedPackage}</div>
          <div>{packages[selectedPackage].name}</div>
        </div>
        <button className="bg-white text-[#A82229] border border-[#A82229] px-4 py-1 rounded">Select</button>
      </div>
      <div className="mb-4">
        <div>160 Varick in Hudson</div>
        <div>{selectedTerm} yr</div>
      </div>
      <div className="mb-4">
        <div className="font-bold">RSF:</div>
        <div className="text-2xl">5,374</div>
      </div>
      {Object.entries(allParams).map(([key, value]) => (
        <div key={key} className={`flex justify-between ${
          (selectedPackage === 'A' && packages.A.params[key] === undefined) ||
          (selectedPackage === 'B' && packages.A.params[key] === undefined && packages.B.params[key] === undefined)
            ? 'opacity-20'
            : ''
        }`}>
          <div>{key}</div>
          <div>${value}</div>
        </div>
      ))}
      <div className="mt-4 pt-4 border-t border-[#A82229]">
        <div className="flex justify-between font-bold">
          <div>TOTAL PER SF</div>
          <div>$234</div>
        </div>
        <div className="flex justify-between font-bold text-xl bg-[#A82229] text-white p-2 mt-2">
          <div>TOTAL MONTHLY</div>
          <div>${(price / 12).toLocaleString()}</div>
        </div>
        <div className="flex justify-between font-bold text-xl bg-[#A82229] text-white p-2 mt-2">
          <div>TOTAL ANNUAL</div>
          <div>${price.toLocaleString()}</div>
        </div>
      </div>
    </div>
  );
};

export default App;
